import { useMediaQuery } from 'react-responsive'
import './exerciseTable.css'
import React from 'react'

const ExerciseTable = () => {
    const isTabletOrMobile = useMediaQuery({query: '(max-width:1224px)'})   

    const exerciseArray = [
        {"name": "Joggen", "time": 30},
        {"name": "Kraftsport", "time": 30}
    ]

    return(
        <div>
            {isTabletOrMobile ? (
                <div>
                    <table>
                        <thead>
                            <th>Name</th>
                            <th>Zeit</th>
                        </thead>
                        <tbod>
                            {exerciseArray.map((item, index) => (
                                <tr key={index}>
                                    <td>{item.name}</td>
                                    <td>{item.time}</td>
                                </tr>
                            ))}
                        </tbod>
                    </table>
                </div>
            ) : (
                <div>
                    Exercise
                </div>
            )}
        </div>
    )
}

export default ExerciseTable;
